import React from 'react';
import styles from './Header.module.css';

const Header: React.FC = () => {
  return (
    <header className={styles.header}>
      <div className={styles.hero}>
        <h1 className={styles.heroText}>Manos bellas, uñas perfectas</h1>
        <p className={styles.heroSubtext}>Descubre la elegancia que tus manos merecen</p>
      </div>
      <nav>
        <ul className={styles.navList}>
          <li><button className={styles.navButton}>Servicios</button></li>
          <li><button className={styles.navButton}>Galería</button></li>
          <li><button className={styles.navButton}>Testimonios</button></li>
          <li><button className={styles.navButton}>Contacto</button></li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
